    "# About the company Bellabeat\n",
    "\n",
    "Urška Sršen and Sando Mur founders of Bellabeat, a high tech company that manufactures helth-focused smart products that informs and inspires women. Sršen believes that new growth opportunities exist to as a forerunner in tech-driven wellness.\n",
    "\n",
    "# Questions for the analysis\n",
    "\n",
    "1. What are some trends in smart device usage? \n",
    "2. How could these trends apply to Bellabeat customers? \n",
    "3. How could these trends help influence Bellabeat marketing strategy\n",
    "\n",
    "# Scenario\n",
    "\n",
    "Utilising existing data, gain insights into consumer smart device usage data in order to provide recommendations for Bellabeat."
   ]
