    "* Calories = 2304\n",
    "        - Generally, the recommended daily calorie intake is 2,000 calories a day for women.\n",
    "\n",
    "* Weight = 72 kgs BMI = 25.19\n",
    "        - below 18.5 – you're in the underweight range.\n",
    "        - between 18.5 and 24.9 – you're in the healthy weight range.\n",
    "        - between 25 and 29.9 – you're in the overweight range.\n",
    "        - between 30 and 39.9 – you're in the obese range.\n",
    "        \n",
    "* Activity\n",
    "    Total distance = 5,49 kms ( which related to the average walk distance per day of 7638 steps)\n",
    "    Sedentary mins = 991 mins or 16 hours \n",
    "    \n",
    "    LOW risk indicates sitting less than 4 hours per day. \n",
    "    MEDIUM risk indicates sitting 4 to 8 hours per day. \n",
    "    HIGH risk indicates sitting 8 to 11 hours per day. \n",
    "    VERY HIGH risk indicates sitting more tahn 11 hours per day.\n",
    "    \n",
    "    Light activity  = 192,8 mins or 3 hours 12 mins\n",
    "    light active distance = 3,34 kms\n",
    "    \n",
    "    As a general goal, aim for at least 30 minutes of moderate physical activity every day. If you want to lose weight, maintain weight loss or meet specific fitness goals, you may need to exercise more. \n",
