    "#Activity\n",
    "\n",
    "ggplot(data=merged_data, aes(x=TotalMinutesAsleep, y=VeryActiveMinutes)) + \n",
    "  geom_point(size=0, shape= 3, colour=\"red\")+ \n",
    "  geom_smooth(colour=\"yellow\")+\n",
    "  geom_density_2d(colour=\"black\")+\n",
    "  labs(title=\"Very active minutes vs Total minutes asleep\")\n",
    "\n",
    "ggplot(data=merged_data, aes(x=TotalMinutesAsleep, y=FairlyActiveMinutes)) + \n",
    "  geom_point(size=0, shape= 3, colour=\"red\")+ \n",
    "  geom_smooth(colour=\"orange\")+\n",
    "  stat_ellipse()+\n",
    "  labs(title=\"Fairly active minutes vs Total minutes asleep\")\n",
    "\n",
    "ggplot(data=merged_data, aes(x=TotalMinutesAsleep, y=LightlyActiveMinutes)) + \n",
    "  geom_point(size=0, shape= 3, colour=\"red\")+ \n",
    "  geom_smooth(colour=\"green\")+\n",
    "  stat_ellipse(type = \"norm\")+\n",
    "  labs(title=\"Lightly active minutes vs Total minutes asleep\")"
   ]
