   "source": [
    "The distribution of data points for the activity vs sleep in the participants was very interesting. \n",
    "\n",
    "- Very active minutes were more likely to be achieved at optimal sleep around 7 hours and 10 hoursand had a mean of 23.97 minutes.\n",
    "- Fairly active minutes were more likely to be achieved around 3-5 hours of sleep with a mean of 17.35 minutes. This could be a determing factor of not being able to do vigorous activity due to lack of sleep.\n",
    "- However light active minutes was achieved at a continuum throughout the sleep range from 5-10 hours of sleep and represented a mean of 200 minutes.\n"
   ]
  },
