   "source": [
    "# Wrap-up:\n",
    "\n",
    "Bellabeat is a business collecting and storing data on tech devices, for use by women in order to make lifestyle changes and healthy alternatives. At this end Bellabeat is leading the technology race. However lifstyles are changing at a rapid rate and the nedd for data in order to manage our lives is of the utmost importance. This cannot be said enough for the amount and quality of sleep we get and need. \n",
    "\n",
    "* Bellabeat is focused on delivering products especially for women, however the Fitbit data did not account for gender, therefore it must be assumed it was mixed data.\n",
    "\n",
    "**The Fitbit data revealed some interesting insights upon which recommendations for Bellabeat could be made.** \n",
    "\n",
    "**State the case**\n",
    "\n",
    "Women increasingly in a busier and more frantic world are facing more and more challenges of balancing a life of work, family, exercise and much much more. The art of balancing all of these comes down to managing time and having the data on hand to do so. \n",
    "\n",
    "Sleep is a consistant upon which all humans thrive or decline, therefore all metrics can be placed aginst it. \n",
    "\n",
    "The analysis revealed some interesting insights, the majority of which fell within the norms of sleep, activity and calorie expenditure.\n",
    "\n",
    "\n",
    "**Application**\n",
    "\n",
    "Applications in general and especially the Bellabeat app should be the lifleline and go to data source for every womens health and wellness needs. In todays chaotic lifestyles sleep is a consistant upon which all our activities are based and should be a measure to achieve all our daily goals, whether it be physical activity, health or calorie expenditure. These insights should be there at the touch of every ladies finger tips. This is where the Bellabeat app could make the difference.  \n",
    "\n",
    "**Bellabeat app recommendations**\n",
    "\n",
    "1. The Bellabeat app could build analysis around what time ladies go to sleep on average and what time they wake up and give reminders on the app to go to bed based on the optimal amount of sleep required. (7-8 hours)\n",
    "\n",
    "2. A notification could also be given prior to sleep in order to take into account the amount of time it takes to fall asleep. (Found to be 39 minutes on average)\n",
    "\n",
    "3. Data could be gathered over time in order to create trends for ladies in order to ascertain just how much sleep is optimal for activity requirements, optimal calorie expenditure and weight gain or loss. This could all be presented on the app and put on to the above two notifications.\n",
    "\n",
    "4. The app could also alert to the amount of sedentary time spent on a day to day basis in order to keep it to minimum or give an alert when too much sedentary time has been spent. \n",
    "\n",
    "**Marketing strategy**\n",
    "\n",
    "The strategy should be aimed at ladies trying to accomplish daily activities in the most effective and healthy way. This cannot be done unless enough sleep is achieved for optimum functioning. A strong pitch to empower women through taking control of their lives through beautifully designed technology that informs and inspires women around the world. \n"
